import React from 'react';

const NotFoundPage = () => {
  return (
    <div>
      <h1>404 - Page Not Found</h1>
      <p>
        The page you were looking for cannot be found! Please check your url.
      </p>
    </div>
  );
};

export default NotFoundPage;
